import React, { Component } from "react";
import Resume from "./resume.json";

class App extends Component {
  componentDidMount() {
    document.title = [
      Resume.basics.name,
      Resume.basics.label,
      [Resume.basics.location.region, Resume.basics.location.country].join(", ")
    ].join(" | ");
  }

  render() {
    return <h1 style={{ color: "red" }}>APP WORKS</h1>;
  }
}

export default App;
